 function App() {
  return (
    <div>
      <Switch>
        <Route  path='/' element={ <HomePage />} />
        <Route path='/hats' element={ <HatsPage/>} />
      </Switch>
    </div>
  );
}


function HatsPage() {
  return(
    <div>
      <h1>Hats Page</h1>
      <p>How many Hats do your want</p>
    </div>
  )
}


export default App;
